import React from 'react'
import { Box, BottomNavigation, BottomNavigationAction, Paper } from "@material-ui/core"
import { AddCircleSharp, CreateSharp, SearchSharp, DeleteSharp, Translate } from "@material-ui/icons"

const [value, setValue] = ['test1', 'test2']

class Item extends React.Component {
  render() {
    return (
      <Box>
        <Paper style={{flex: 1, flexDirection: 'column', justifyContent: 'flex-end'}}>
          <BottomNavigation
            style = {{width : '500px', height : ''}}
            showLabels
            value={value}
            onChange={(event, newValue) => {
              setValue(newValue);
            }}
          >
            <BottomNavigationAction
              label="제품 추가"
              icon={<AddCircleSharp />}
            />
            <BottomNavigationAction label="제품 검색" icon={<SearchSharp />} />
            <BottomNavigationAction label="제품 수정" icon={<CreateSharp />} />
            <BottomNavigationAction label="제품 삭제" icon={<DeleteSharp />} />
          </BottomNavigation>
        </Paper>
      </Box>
    );
  }
}

export default Item;
